import StudentList from "./StudentList";
import {useEffect, useState} from "react";

const CoursePage =()=>
{
    const [data, setData] = useState([])

    const fetchData=async () => {
        console.log("fetch")
        setInterval(async () => {
            setData(await StudentService.fetchAllStudents())
        }, 1000*10)

    }

    useEffect(()=>{
        console.log("useEff")
        fetchData().then()
    })

    return(
        <StudentList data = {data}/>
    )

}

